import React from 'react';
import Boxtop from './boxtop';
import Boxbottom from './boxbottom';
import Cruises from './cruises';

class Cruisesbox extends React.Component{
    render(){
        return(
            <div>
            <Boxtop 
                head="hello" 
                sub="hi"/>

                <Cruises/>

                <Boxbottom 
                footer="hi"
                footerb="bye"
                /> 
            </div>


        );
    }
}
export default Cruisesbox;
